import React from 'react';

const HeaderTop = () => {
    return (
        <div className="header-top">
            <ul>
                <li><i class="fa fa-heart" aria-hidden="true"></i>Sản phẩm yêu thích</li>
                <li>Đăng nhập</li>
                <li>Đăng ký</li>
                <li>Đăng Xuất</li>
            </ul>
        </div>
    );
};

export default HeaderTop;
